import "./Navbar.css";

import { Link } from 'react-router-dom';

function Navbar() {
  return (
    <nav className="navbar">
			<div className="navbar-container">
				<Link to="/our_story">Our Story</Link>
				<Link to="/experience">The experience</Link>
				<Link to="/rsvp">RSVP</Link>
			</div>			
    </nav>
  )
}

export default Navbar
